
import type { ReactiveValue } from "./types";
import { isReactiveValue, effect } from "./signals";

class EventTargetBuilder {
  el: EventTarget;
  constructor(el: EventTarget) {
    this.el = el;
  }
}


class NodeBuilder extends EventTargetBuilder {
  el: Node;
  constructor(el: Node) {
    super(el);
  }

  nodeValue(value: ReactiveValue<string>): this {
    if (isReactiveValue(value)) {
      effect(() => {
        this.el.nodeValue = value();
      });
      return this
    }
    this.el.nodeValue = value;
    return this;
  }

  textContent(value: ReactiveValue<string>): this {
    if (isReactiveValue(value)) {
      effect(() => {
        this.el.textContent = value();
      });
      return this
    }
    this.el.textContent = value;
    return this;
  }
}


